import React from 'react';
function Header(){
    return(
        <div className="wrapper">
            <div className="container">
                <a href="#" className="header-logo">
                    <img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo">
                    </img>
                    
                </a>
                <span>AAPet</span>  
            </div>
        </div>
    )
};
export default Header;
